import "./indexpage.css";
import alltiles from './tilesfile.json'

const Tiles = styled.div`
    border:2px solid red;
    display:flex;
    justify-content:center;
    flex-wrap:wrap;
    

`;

const MainIndexComponent = () => {
    return (
        <>
            <h3 className='subheading-1'>Most Popular Tiles Variety</h3>
            <Tiles>
                <div className="tilemain-container">
                        {alltiles.map((gettile) => {
                            return (
                                <>
                                        <span key={gettile.id}></span>
                                        <img className="tilesImages" src={gettile.url} alt='tiles'/>
